Text:
@KAliy3v Hədiyyələr:
2 otaqlı təmirli mənzil - 1 ədəd;
Toyota Corolla - 2 ədəd;
MacBook Air - 10 ədəd;
iPhone 14 Pro - 10 ədəd.

@Fidan0nine Salam!
Zəhmət olmasa, Sizə zəng olunan mobil nömrənizi qeyd edərdiniz. 
Birbank tətbiqi ilə bağlı yoxlanış apara bilməyimiz üçün Birbank mobil tətbiqində “Bankla əlaqə” &gt; “Çat” bölməsindən bizə yazmağınızı xahiş edirik.

@nigarhuseyn_ Standart olaraq müraciət və təkliflərin baxılma müddəti 10 iş günüdür.
Ən qısa müddətdə Sizə köməklik göstəriləcəkdir. 
Kartın PIN blokdan aktiv olunması ilə bağlı 196 ƏM ilə əlaqə saxlamağınız mümkündür.

@nigarhuseyn_ Qeydə alınan müraciətiniz hazırda  icradadır və araşdırılır.
Nəzərinizə çatdıraq ki, müraciətlərin icra müddəti 10 iş günüdür.
Nəticə olduğu zaman, Sizə məlumat bidiriləcəkdir.

@nigarhuseyn_ Gözləmə vaxtının çox olduğuna görə təəssüf edirik.
Hazırda daxil olan müraciətlər növbəli şəkildə cavablandırılır və biz bunun daha operativ olması üçün əlimizdən gələni əsirgəmirik.
Operator ən qısa müddətdə Sizə məlumat təqdim edəcəkdir.

@kenankazimov Salam!
Ödəniş tam olaraq nağdsız və ya birdəfəlik şəkildə kartla ödənilməldir. Bu haqda məlumat kart istifadəyə verilən gündən müştərilərə təqdim olunub. 
https://t.co/ut2g8Pl005

@hasanli_sr Salam, hər vaxtınız xeyir.
Birbank üzrə təkmilləşdirmə işləri artıq başa çatmışdır. Birbank qeydiyyatınıza giriş edərək maneəsiz yararlana bilərsiniz. 
Müvəqqəti narahatlığa görə üzr istəyirik.

@hasanli_sr Salam.
Birbank tətbiqində təkmilləşdirmə işlərinin aparılması səbəbindən müvəqqəti çətinliklərlə qarşılaşmanız mümkündür. Təkmilləşdirmə işləri yekunlaşdıqda, tətbiqdən maneəsiz yararlana biləcəksiniz.
Yaranmış müvəqqəti narahatlığa görə Sizdən üzr istəyirik.

@muradova_vusale Salam, hər vaxtınız xeyir. 
Birbank tətbiqində təkmilləşdirmə işlərinin aparılması səbəbindən müvəqqəti çətinliklərlə qarşılaşmanız mümkündür.
Təkmilləşdirmə işləri yekunlaşdıqda tətbiqdən maneəsiz yararlana biləcəksiniz.

@jamalaghayevin Salam, Camal bəy.
"Kapital Bank” ASC-nin BirBank tətbiqində təkmilləşdirmə işlərinin aparılması səbəbindən müvəqqəti çətinliklərlə qarşılaşmanız mümkündür.
Yaranmış müvəqqəti narahatlığa görə Sizdən üzr istəyirik. 🙏

@RuslandeSoul Salam, hər vaxtınız xeyir. 
İlk öncə qeyd etmək istərdik ki, yaranmış hal ilə bağlı təəssüf edirik.
Məlumatları qeyd etdiyiniz üçün təşəkkür edirik, bununla bağlı kart hesabınız yoxlanılmalıdır.

@ulkarhsnli Kapital Bank ATM-də nağdlaşdırma etmisiniz, Ülkər xanım?
Əmək haqqı kartlarına kənar mədaxil/köçürmə əməliyyatına görə 1% (min. 1 AZN) komissiya tutulur.
Zəhmət olmasa, onlayn növbə ilə bağlı müraciətinizi ətraflı qeyd edəsiniz.

@sevashkab Salam.
Belə düşüncədə olmağınız bizi çox təəssüfləndirir.
Narazılığınızın səbəbini aydın qeyd etməyiniz xahiş olunur. Düşüncələrinizin müsbət yöndə dəyişilməsində yardımçı olmaq istərdik.

@HalduNovruzzade Salam.
Belə düşüncədə olmağınız bizi çox təəssüfləndirir.   
Narazılığınızın səbəbini daha aydın qeyd etməyiniz xahiş olunur. Düşüncələrinizin müsbət yöndə dəyişilməsində yardımçı olmaq istərdik.

@bckdfckp Salam.

Müraciətiniz ilə bağlı köməklik göstərə bilməyimiz üçün Birbank mobil tətbiqində: Daha çox – Bankla əlaqə – “Çat” bölməsindən yazaraq operator ilə əlaqə saxlamağınızı xahiş edirik.
Birbankınız yoxdursa, onu bu linkdən yükləyə bilərsiniz https://t.co/cgjVUuy8Nn

@kamran_904 Salam, hər vaxtınız xeyir.
İlk öncə qeyd etmək istərdik ki, Sizdə bu cür fikir formalaşdığı üçün təəssüf edirik.
Əmək haqqı və pensiya hesablarından filialda məxaric zamanı 2% min. 10 AZN komissiya tutulur.

@glva_ay Salam, hər vaxtınız xeyir.
Bəli, əlaqə saxlanılan zaman qeyd olunan məlumatlar kart sahibindən dəqiqləşdirilir.
Həmçinin, təklifinizin aydınlaşdırılması və qeydə alınması üçün kart sahibi Birbank mobil tətbiqində “Bankla əlaqə” &gt; “Çat” bölməsindən bizə yaza bilər.
